import React from 'react';

function CardMovie({
  poster_path,
  original_title,
  overview,
  genres,
  vote_average,
  release_datere,
}) {
  return (
    <div className="cardMovie">
      <div>
        <img src={poster_path} alt="Photo title" />
      </div>
      <div>
        <h2>
          {original_title} ({release_datere})
        </h2>
        <div>
          <h3>Overview</h3>
          <p className="overview">{overview}</p>
        </div>
        <h3>Genres</h3>
        <p>{genres}</p>
        <p>{vote_average}</p>
      </div>
    </div>
  );
}

export default CardMovie;
